import React, { lazy, Suspense } from 'react';
import { Row, Col } from 'antd';
import { Link } from 'react-router-dom';
//import { GlobalLoading } from './../../components';
import { ToolPost, ListContent } from './Components';
import './styles.css';

function Home(props) {
    return (
        <>
            <Link to='/about'>about</Link>
            <Row gutter={[34, 34]}>
                <Col lg={10} md={10}>
                    <ToolPost />
                </Col>
            </Row>
            <Row gutter={[34, 34]}>
                <Col>
                    <ListContent />
                </Col>
            </Row>
        </>
    );
}
export default Home;
